import * as React from "react";
import Header from "../../components/Header/Header";
import { makeStyles } from "@material-ui/core/styles";
import styles from "../../assets/jss/material-kit-react/views/landingPage.js";
import './mnemonic.css'
import GridContainer from "../../components/Grid/GridContainer";

const useStyles = makeStyles(styles);
export default  function CreateMnemonicPage(props){
    const classes = useStyles();
    return (
        <div>
            <Header
                color="transparent"
                brand="Private.Storage"
                fixed
                changeColorOnScroll={{
                    color: "white",
                }}
            />
            <div className={classes.container}>
                <GridContainer >
                    <div className="create-mnemonic-tips">
                        <div >
                            <h1 className={classes.title}>>账户助记词</h1>
                            <h4>
                                您的账户助记词可以帮助您轻松备份和恢复个人账户。
                                警告：切勿向他人透露您的账户助记词。任何人一旦持有该账户助记词，即可控制您的 Ether
                            </h4>
                        </div>
                    </div>
                </GridContainer>
            </div>

        </div>
    );
}
